import React from 'react'
import CarRentalIcon from '@mui/icons-material/CarRental';

const Bookrideform = () =>{
    return(
        <div>
                <h1> Book a Car</h1>
                <div>
                    <CarRentalIcon></CarRentalIcon>
                    <input type="text" maxLength={50}></input>
                </div>
        </div>
    )
}
export default Bookrideform
